import PropTypes from 'prop-types'
import APIService from '../APIService';
import React, {useState, useEffect} from 'react'

function WorkoutList(props) {

    const [new_workout, setNewworkout] = useState('')
    const [exercise_list, setExerciselist] = useState([])

    const editBtn = (workout) =>{
        props.editBtn(workout)
    }
    // console.log(props.workouts)
    // console.log(props.exerciselist)
    useEffect(() => {
        for (let elem in props.workouts){
            console.log(props.workouts[elem].id)
            fetch(`http://127.0.0.1:8000/active/${props.workouts[elem].id}`, {
                'method':'GET',
                headers: {
                    'Content-Type':'application/json',
                }
                })
                .then(resp => resp.json())
                .then(resp => setExerciselist(...exercise_list,resp))
                .then(resp => console.log("SADASD-",resp))
                .catch(error => console.log(error))
        }    
      }, [])
        // let zipped = props.workouts.map((x, i) => [x, exercise_list[i]])
    return (
        <div className="WorkoutList">
            {props.workouts && props.workouts.map((workout,index) => {
                return (
                    <div key = {workout.id}>
                        <h3>{workout.title}</h3>
                        <h3>{exercise_list[index]}</h3>
                        {/* <h3>{workout[1]}</h3> */}

                        <div className = "row">
                            <div className = "col-md-1">
                                <button className = "btn btn-primary" onClick  = {() => editBtn(workout)}> Update</button>
                            </div>
                            <div className = "col-md-2">
                                <button className = "btn btn-success" onClick  = {() => editBtn(workout)}> Add new</button>
                            </div>
                        </div>
                    </div>
                )
                })}
            </div> 
    )
}

WorkoutList.propTypes = {
    // workouts: []
}

export default WorkoutList
